import React, { Component } from 'react';
import YoutubeComponent from '../../component/YoutubeComponent/YoutubeComponent';

class home extends Component {
    render() {
        return (
            <div>
                <p>Youtube Component</p>
                <hr />
                <YoutubeComponent
                    time="4.30"
                    title="Learning React Eps1" />
                <YoutubeComponent
                    time="5.10" title="Learning React Eps2" />
                <YoutubeComponent
                    time="10.20" title="Learning React Eps3" />
                <YoutubeComponent
                    time="30.40" title="Learning React Eps4" />
                <YoutubeComponent
                    time="10.04" title="Learning React Eps5" />
                <YoutubeComponent />
            </div>
        )
    }
}

export default home;
